import React from 'react';
import './Button.css';

export class Button extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  handleOnClick(text) {
    const string = "politics";
    this.props.onButtonClick(string);
  }

  render() {
    return (<button onClick={this.handleOnClick}>{this.props.text}</button>);
  }
}
